import React from 'react';
import './snake.css';
import snake from "./snake.png"
const Snake = ({ start, end }) => {
  const cellSize = 50;
  const startX = ((start - 1) % 10) * cellSize;
  const startY = 450 - Math.floor((start - 1) / 10) * cellSize - cellSize;
  const endX = ((end - 1) % 10) * cellSize;
  const endY = 450 - Math.floor((end - 1) / 10) * cellSize - cellSize;
  const width = Math.abs(endX - startX) + cellSize;
  const height = cellSize;
  const style = {
    left: Math.min(startX, endX),
    bottom: startY,
    width,
    height,
  };
  return (<div className="snake-container">
  <img src={snakeImg} alt="snake" />
  <div className="snake" style={{ gridArea: `${start} / 1 / ${end} / 2` }}></div>
</div>);
};

export default Snake;
